import { StoreContext } from "./storeContext";
import React, { useContext } from "react";


const PrintJokes = () =>{
  const [store, setStore] = useContext(StoreContext);
  const tst = useContext(StoreContext);
  return(
    <div>

      {console.log("printis ollaa:"+tst)}
      
      <p>pöö</p>
      <p>pöö</p>
      <pre>{JSON.stringify(store.items)}</pre>
      {console.log(JSON.stringify(store.jokes["joke"]))}
    </div>
  )
}
export default PrintJokes;
